window.bookSummaryJSON = "<p>Once he was the gaijin champion of a cruel and oppressive empire. Now Dev Cameron is a military commander for the rebellious newborn Confederation and at tentative peace with the galaxy's all-powerful rulers. But treachery has shattered the uneasy truce, as the imperial lords prepare to rain destruction down upon the outpost of New America, delivering the final death blow to the still young revolution. And now only one incomprehensible act can save Dev Cameron and his cause: a miraculous link with an alien self that could change the course of the future...by transforming a man into a god.</p>"; 
